import React, { useState } from "react"
import Login from "./User"
import { Navigate } from "react-router-dom"

function Dashboard({  }) {
    const { currentUser } = Login()
    if (currentUser === false){
        return(
            <Navigate to="/login" />
        );
    } else {
        return(
            <div>Hello World</div>
        )
    }
}


export default Dashboard;
